<script type="text/javascript"> 
    // partner-specific web-search.xml
    (function() {
      var qs = location.search || '';
      var params = [];
      var p = 'web';

      qs = qs.replace('?', '');
      params = qs.split('&');

      for(var i = 0; i < params.length; i++) {
        var keyvalue = params[i].split('=');
        if(keyvalue[0] == 's') {
          p = keyvalue[1];
          break;
        }
      }

      document.write('<link rel="search" type="application/opensearchdescription+xml" href="/web-search.xml?p=' + p + '" title="Web Search" />');
    })();
  </script>
